// "SPDX-License-Identifier: MIT"
pragma solidity ^0.8.4;
// reasons
    // 0 -> You are trying to change your own admin state
    // 1 -> league does't exist
    // 2 -> You can't perform this action (in leagueActionControl)
    // 3 -> "player doesn't exist"
    // 4 -> "Can only edit waiting league"
    // 5 -> "len(winConds) != len(winCondOps)+1"
    // 6 -> "liveTime must >= 0"
    // 7 -> "closeTime must >= liveTime"
    // 8 -> "maxPlayer must >= 0"
    // 9 -> "maxPlayer must >= number of joined players"
    // 10 -> "initReward != msg.value"
    // 11 -> "minEntry must >= 0"
    // 12 -> "This league is not open"
    // 13 -> "manager who made league can't join"
    // 14 -> "league Full"
    // 15 -> "Nickname taken"
    // 16 -> "Address've registered"
    // 17 -> "Acc blocked from joining things"
    // 18 -> "Provide the exact value of minimum entry requirement (wei)"
    // 19 -> "insufficient fund"
    // 20 -> "Must be [Live] to close"
    // 21 -> "player not in league"
    // 22 -> "blocked player, can't be winner"
contract LMRevertReasons {
    uint256 constant  public nReason=22;
    string[23] public reasons=["You are trying to change your own admin state",
            "league does't exist",
            "You can't perform this action (in leagueActionControl)",
            "player doesn't exist",
            "Can only edit waiting league",
            "len(winConds) != len(winCondOps)+1",
            "liveTime must >= 0",
            "closeTime must >= liveTime",
            "maxPlayer must >= 0",
            "maxPlayer must >= number of joined players",
            "initReward != msg.value",
            "minEntry must >= 0",
            "This league is not open",
            "manager who made league can't join",
            "league Full",
            "Nickname taken",
            "Address've registered",
            "Acc blocked from joining things",
            "Provide the exact value of minimum entry requirement (wei)",
            "insufficient fund",
            "Must be [Live] to close",
            "player not in league",
            "blocked player, can't be winner"];
    constructor () {
    }
    function getReason(uint256 id) view public returns(string memory) {
        return reasons[id];
    }
}

